resources.description:
You can specify multiple example responses -- now with status codes! Instead of `<!-- RESPONSE -->` you can write `<!-- RESPONSE 200 -->`. You still have to close it using `<!-- ENDRESPONSE -->` though!

<!-- RESPONSE 200 -->
{
  "ok": true,
  "token": "123abc"
}
<!-- ENDRESPONSE -->

<!-- RESPONSE 400 -->
{
  "ok": false,
  "error": "Username or password not provided."
}
<!-- ENDRESPONSE -->

<!-- RESPONSE 401 -->
{
  "ok": false,
  "error": "Incorrect username and/or password."
}
<!-- ENDRESPONSE -->

This endpoint uses the Bearer token associated with the current session of the user and creates dependents for the user <!-- RESPONSE --> {
  "message": "Successfully added dependent"
} <!-- ENDRESPONSE -->

This endpoint registers a user to the system, The newly registered user will have limited access to the system until approved <!-- RESPONSE --> {
  "message": "Successfully created a patient"
} <!-- ENDRESPONSE -->
